import React from 'react'
import LionsDen from '../assets/Logo.png'

function Logo() {
  return (
    <div className='bg-black flex flex-col justify-center'>
        <img src={LionsDen} alt="LionsDen Logo" />
        <h1>"Bringing Southern Hospitality To Southern California"</h1>
    </div>
  )
}

export default Logo
